webpackJsonp([950821458508764e4],{"./node_modules/json-loader/index.js!./.cache/json/machine-learning-reinforcement-learning.json":function(e,n){e.exports={data:{markdownRemark:{html:'<h4>Suggested Reading:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ul>\n<li><a href="http://incompleteideas.net/sutton/book/the-book-2nd.html">http://incompleteideas.net/sutton/book/the-book-2nd.html</a></li>\n</ul>\n<h4>Reinforcement Learning</h4>\n<!-- Please add your working draft below in GitHub-flavored Markdown -->\n<p>Reinforcement Learning refers to a field of Machine Learning that applies to agents that you reinforce by giving them reward and punishment. It gives a nice gradual learning and can simplify the learning of agent in tasks where you cannot determine a proper error value.</p>\n<p>Example:\nA bot is given task to play Space Invaders, it tries to learn to play it by interacting with game and in return getting a reward for the points that it scored at end of game. Greater the reward, greater are its chances of doing the similar gameplay.</p>\n<p>In industries robot uses deep reinforcement learning to pick a device from one box and putting it in a container. Whether it succeeds or fails, it memorizes the object and gains knowledge and trainâ€™s itself to do this job with great speed and precision. Learning on its own is a kind of reinforcement learning provided the learning is in positive dimension.</p>',fields:{slug:"/machine-learning/reinforcement-learning/"},frontmatter:{title:"Reinforcement Learning"}}},pathContext:{slug:"/machine-learning/reinforcement-learning/"}}}});
